import { BrowserRouter, NavLink, Route, Routes } from 'react-router-dom';
import './App.css';

const RoomSettings = () => {
  return (
    <div>
      hello
    </div>
  );
}

const App = () => {
  return (
    <BrowserRouter>
      <div>
        <header>
        </header>
        <body>
          <div className='roomSettingsButton'>
            <NavLink to='/roomSettings'>Перейти в настройки переговорной комнаты</NavLink>
            <NavLink to='/'>назад</NavLink>

          </div>
          <Routes>
            <Route path='/roomsettings/*' element={<RoomSettings></RoomSettings>}></Route>
          </Routes>
        </body>
      </div>
    </BrowserRouter>
  );
}

export default App;
